import React , { useState } from 'react';
import { View , Text , Stylesheet } from 'react-native';

import { PinInput , Stack } from 'native-base';

function PinView( props ) {

    const [code , setCode] = useState('');

    return(
        <View>
            <Stack space={10}>
                <PinInput inputSize="md" value={code} variant="filled" space={7} onChangeText={text => setCode(text)}>
                    <PinInput.Field style={{width: 60 , height: 50}}/>
                    <PinInput.Field style={{width: 60 , height: 50}}/>
                    <PinInput.Field style={{width: 60 , height: 50}}/>
                    <PinInput.Field style={{width: 60 , height: 50}}/>
                </PinInput>
            </Stack>
        </View>
    )
}
export default PinView;
